import React, {Component} from 'react';
import Title from "../Title/Title";
import './Main.css'
import SimpleText from '../SimpleText/SimpleText'
import Slider from "react-slick";
class Main extends Component {
    constMainTextStyle={
        color:'white'
    };
    render() {
        return (
            <div className="main">
                <div className="main__inner">
                    <div className="main-text-container">
                <Title text="Психотерапевт Марія Шугай" style={this.constMainTextStyle}/>
                       <SimpleText text="Сертифікований та акредитований гештальт-терапевт, керівник навчальних та терапевтичних програм" style={this.constMainTextStyle}/>
                        <SimpleText text="Директор Інституту практичної психології та психотерапії Національного університету «Острозька академія»"style={this.constMainTextStyle}/>
                    </div>
                <img
                    width="50%"
                    height="50%"
                    src="https://posterix.com.ua/images/product_images/popup_images/24522216-fotooboi-368-254sm-svetlaya-doroga-na-plyazh-11600cn.jpg"
                    />
                </div>
            </div>
        );
    }
}

export default Main;
